Principal Investment Strategies

Ivy LaSalle Global Risk-Managed Real Estate Fund is a non-diversified fund that invests, under normal circumstances, at least 80% of its net assets in securities of companies in the real estate or real estate-related industries. The Fund intends to invest primarily in equity and equity-related securities issued by “Global Real Estate Companies,” which are companies that meet one of the following criteria:

∎	 	companies qualifying for U.S. Federal income tax purposes as real estate investment trusts (REITs);

∎	 	entities similar to REITs formed under the laws of a country other than the U.S.;

∎	 	companies located in any country that, at the time of initial purchase by the Fund, derive at least 50% of their revenues from the ownership, construction, financing, management or sale of commercial, industrial or residential real estate, or that have at least 50% of their assets invested in such real estate; or
